import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // --- STRESS TEST: RAPID ADD ---
    // Locate all "Add to Cart" buttons that are not disabled
    const addToCartButtons = await page.locator('button.add-to-cart:not([disabled])').all();
    if (addToCartButtons.length < 4) {
      throw new Error('Could not find enough "Add to Cart" buttons to perform the test.');
    }

    // Rapidly click the first 4 "Add to Cart" buttons
    for (let i = 0; i < 4; i++) {
      await addToCartButtons[i].click();
    }

    // Wait for the cart counter to update and verify it
    await page.waitForFunction(() => document.querySelector('.cart').innerText.includes('4'));
    const cartCountAfterAdd = await page.locator('div.cart').innerText();

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_items_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_items_added.png'));

    // --- VERIFY CART CONTENT ---
    // Open the cart modal
    await page.locator('div.cart').click();
    await page.waitForSelector('.cart-item', { timeout: 5000 });

    const itemsInCart = await page.locator('.cart-item').count();

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_open.png'));

    // --- STRESS TEST: RAPID REMOVE ---
    const removeButtons = await page.locator('button.remove-item').all();
    if (removeButtons.length !== 4) {
        throw new Error(`Expected 4 remove buttons in cart, but found ${removeButtons.length}.`);
    }

    // Rapidly click all "Remove" buttons
    for (const button of removeButtons) {
        await button.click();
    }

    // Wait for the cart to show the empty message
    await page.waitForSelector('.empty-cart', { timeout: 5000 });
    const cartCountAfterRemove = await page.locator('div.cart').innerText();

    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_cart_emptied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_cart_emptied.png'));

    return {
      success: true,
      action: "Successfully performed a rapid add-and-remove cart stress test.",
      extractedData: {
        cartCountAfterAdd: cartCountAfterAdd.trim(),
        itemsInCartModal: itemsInCart,
        cartCountAfterRemove: cartCountAfterRemove.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // In case of an error, capture the final state
    await page.screenshot({ path: path.join(screenshotsDir, 'error.png') });
    screenshots.push(path.join(screenshotsDir, 'error.png'));

    return {
      success: false,
      action: "Failed to complete the rapid cart manipulation stress test.",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
